superMiscConds.notes:
Defendant shall pay supervisory fees to the Department of Corrections;
Defendant shall complete any/all counseling, evaluations (including psychological), assessments, and follow-up as deemed appropriate;
Defendant shall not possess/consume any alcohol, controlled substances or drug paraphernalia;
Defendant shall submit DNA sample and pay costs;
Defendant shall comply with Sex Offender Registry Program under 301.45, Wis. Stats. for the remainder of life;
Defendant shall not obtain employment in which there will be contact with children under the age of 18;
Defendant shall not have contact with the victim (D.M.H.), victim's family or victim's residence;
Restitution shall be ordered for any/all ongoing counseling/therapy of the victim and/or family IF the family wishes to provide that information.

